short int read_video_pixel(int x, int y) {
	volatile int* Buffer = (int*)FPGA_PIXEL_BUF_BASE;
    return *(volatile short int*)(((int)Buffer) + (y << 10) + (x << 1));
}

void liveVideo() {
	volatile int * pixel_ctrl_ptr = (int *)PIXEL_BUF_CTRL_BASE;
    volatile int* Video_in_controller = (int*)0xFF20306C;
    *Video_in_controller = 0x4;
    
    while (1) {
        for (int x = 0; x < MAX_X; x++) {
            for (int y = 0; y < MAX_Y; y++) {
                short int value = read_video_pixel(x,y);
                if (mirrorFilter) {
                    if (x > MAX_X / 2) value = read_video_pixel(MAX_X - 1 - x, y);
                } else if (invertFilter) {
                    value = ~value & 0xFFFF;
                } else if (sepiaFilter) {
                    value = value & 0b1111111111000000;
                } else if (demonFilter) {
                    value = value & 0b1111100000000000;
                }else if (randomFilter) {
                     value -= read_video_pixel(x+1, y);
                }
                plot_pixel(x, y, value);
            }
        }
		video_box(0, 200, 150, 240, 15416);
		
        wait_for_vsync();
        pixel_buffer_start = *(pixel_ctrl_ptr + 1);
		
		if(returnToMain){
			break;
		}
    }
}

void video_box(int x1, int y1, int x2, int y2, short pixel_color) {
	int pixel_buf_ptr = *(int *)PIXEL_BUF_CTRL_BASE;
	int pixel_ptr, row, col;

	for (row = y1; row <= y2; row++){
		for (col = x1; col <= x2; ++col) {
			pixel_ptr = pixel_buf_ptr + (row << (10)) + (col << 1);
			*(short *)pixel_ptr = pixel_color; // set pixel color
		}
	}
}

